import React from "react";
import "../stylesheets/Club.scss";

const Club = (props) => {
  const renderMembers = () => {
    return props.eachClub.members.map((member) => {
      return <li>{member}</li>;
    });
  };
  return (
    <article>
      <i className={`icon ${props.eachClub.fa}`} />
      <div>
        <h2 className="item__title">{props.eachClub.name}</h2>
        <ul>
          Members:
          <li className="item__members">{renderMembers()}</li>
        </ul>
      </div>
    </article>
  );
};

export default Club;
